import './style.css'
import RoomItem from '../../components/RoomItem'
function HomePage() {
    return (
        <div className = 'home-content-wrapper'>
            <div className = 'home-content-inner'>
                <RoomItem></RoomItem>
                <RoomItem></RoomItem>
                <RoomItem></RoomItem>
                <RoomItem></RoomItem>
            </div>
        </div> 
    );
}

export default HomePage;
